import React from 'react';
import dmx from './../common/tracks/dmx.mp3';
import styles from './Music.module.css'


class Music extends React.Component {
    render() {
        return (
            <div className={styles.tracks}>
                <div>
                    <ReactAudioPlayer
                        src="my_audio_file.ogg"
                        autoPlay
                        controls
                    />
                </div>
            </div>

        );
    }
}


export default Music
